import './navbar.styles.css';
import FilterBy from '../filter/filter.component';

function Navbar({ handleSubmit }) {
    return (
        <div className="search-box">
            <h1 className="navbarTitle">Escriba el nombre del país que está buscando</h1>
            <form onChange={handleSubmit}>
                <input placeholder='Búsqueda' type="search" id='busqueda' />
                <button type='submit'
                onClick={handleSubmit}
                ><img src="https://www.soyhenry.com/_next/image?url=https%3A%2F%2Fassets.soyhenry.com%2Fhenry-landing%2Fassets%2FHenry%2Flogo-white.png&w=128&q=75" /></button>
                {/* <FilterBy>

                </FilterBy> */}
            </form>
        </div>
    );
}

export default Navbar;
